import React from "react";
import { Button, Grid, TextField } from "@mui/material";
import WifiPasswordIcon from "@mui/icons-material/WifiPassword";

export const Home = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={2.5}>
        <h2>RESTO POS</h2>
      </Grid>
      <Grid item xs={4}>
        <TextField
          variant="outlined"
          label="Search Products...."
          fullWidth
          style={{ marginTop: 10 }}
        />
      </Grid>
      <Grid item xs={3}></Grid>
      <Grid item xs={0.5} style={{ marginTop: 10 }}>
        <WifiPasswordIcon />
      </Grid>
      <Grid item xs={0.5} style={{ marginTop: 10 }}>
        logo
      </Grid>
      <Grid item xs={1.5} style={{ marginTop: 10 }}>
        <Button variant="contained" color="success" fullWidth>
          Select Table
        </Button>
      </Grid>
    </Grid>
  );
};
